        var allOtpData = await dapperService.GetOtpDetailsAsync();
        var otpData = allOtpData.FirstOrDefault(f => f.Email.ToLower() == ForgotEmail.ToLower() && f.IsValid == false);
        if (otpData != null)
        {
            string message = $"Your one time password is {otpData.Otp}";
